// Tree traversal function
inline double traverse(const TreeNode* t, const double* x) {
    int n = 0;
    while (t[n].feature >= 0) {
        n = (x[t[n].feature] < t[n].threshold) ? t[n].left : t[n].right;
    }
    return t[n].value;
}

// Prediction function
inline double predict(const double* features) {
    // Normalize features if needed
    double normalized[N_NORM_FEATURES];
    for (int i = 0; i < N_NORM_FEATURES; ++i) {
        normalized[i] = (features[i] - COL_MEANS[i]) / COL_STDS[i];
    }
    
    // Traverse all trees
    double sum = BASE_SCORE;
    for (int i = 0; i < N_TREES; ++i) {
        sum += traverse(TREES[i], normalized);
    }
    
    // Denormalize target
    return sum * TARGET_SCALE + TARGET_MEAN;
}

